import Stack from '@material-ui/core/Stack';
import Box from '@material-ui/core/Box';
import { styled } from '@material-ui/core/styles';
import useWindowDimensions from '../../components/ui/Window.js';
import theme from "../../components/ui/Theme.js";
import { Parallax } from 'react-parallax';

import brot1 from '../../resource/images/brot1.png';
import brot2 from '../../resource/images/brot2.png';
import brot3 from '../../resource/images/brot3.png';
import brot4 from '../../resource/images/brot4.png';
import brot5 from '../../resource/images/brot5.png';

import ab from '../../resource/images/ab.png';
import a1 from '../../resource/images/a1.png';
import a2 from '../../resource/images/a2.png';
import a3 from '../../resource/images/a3.png';




const Section = styled(Box)(({ theme }) => ({
    width: `100%`,
    backgroundColor: theme.palette.success.main,
    backgroundImage: `url(${brot5})`,
    backgroundSize: `auto 100%`,
    backgroundPosition: `center`
}));

function MainPage() {
    const height = useWindowDimensions().height * 1.5;

    // var element = document.getElementById("1");
    // element.scrollIntoView({ behavior: "smooth", block: "center" });

    return (
        <Stack>

            <Parallax bgImage={ab} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Parallax bgImage={a1} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                    <Parallax bgImage={a2} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                        <Parallax bgImage={a3} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>

                            <Section id="1" style={{ height: height }} sx={{ mt: height / 8 }}> ASDF </Section>

                        </Parallax>
                    </Parallax>
                </Parallax>
            </Parallax>

            <Parallax bgImage={brot2} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

            <Parallax bgImage={brot3} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

            <Parallax bgImage={brot4} strength={1200} bgImageStyle={{ marginTop: `-50%` }}>
                <Section style={{ height: height }} sx={{ mt: height / 8 }} />
            </Parallax>

        </Stack>
    )
}

export default MainPage;
